import axios from 'axios';
import React, { useEffect, useState } from 'react'

const List = () => {

  const [list, setlist] = useState([]);

  useEffect( () => {
    axios.get("http://127.0.0.1:8000/retail/create/")
    .then( (response) => {
      setlist(response.data);
    } )
    .catch( (err) => {
      console.log(err);
    } )
  }, [] );

  return (
    <div>
      { list.length > 0 ? (
        <>
        { list.map( (item) => (
          <div key={item.retail_id}> 
          <p>{item.email}</p>
          <a href={'http://localhost:3000'+item.image}>image link</a>
          </div>
        ) ) }
        </>
      ) : ('NO DATA TO DISPLAY') }
    </div>
  )
}

export default List
